import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button';
import './sign_up.css';

class SignUp extends React.Component{

  render(){
    return(
      <Button className="button4"  size="lg">
      <b>Sign Up</b>
      </Button>
    )
  }
}

export default SignUp;
